  // Obtenemos el id desde la URL usando useParams
  const { id } = useParams();

  return (
    <div>
      <h1>Perfil del Usuario</h1>
      <p>ID del usuario: {id}</p>
      {/* Aquí puedes agregar más lógica, por ejemplo, una llamada al backend para recuperar datos del usuario */}
    </div>
  );
};

export default UserProfile;
